To create a Rust app that supports the ElevenLabs API and can read the contents of the clipboard aloud using text-to-speech (TTS), you'll need to follow these steps:

1. Set up a new Rust project:
   - Open your terminal and navigate to the directory where you want to create your project.
   - Run the command `cargo new tts_app` to create a new Rust project named "tts_app".
   - Change into the project directory: `cd tts_app`.

2. Add the necessary dependencies to your `Cargo.toml` file:
   ```toml
   [dependencies]
   reqwest = { version = "0.11", features = ["json"] }
   serde = { version = "1.0", features = ["derive"] }
   serde_json = "1.0"
   clipboard = "0.5"
   ```

3. Obtain an API key from ElevenLabs:
   - Go to the ElevenLabs API documentation website and sign up for an account.
   - Obtain your API key from the dashboard.

4. Create a new file named `elevenlabs.rs` in the `src` directory and add the following code:
   ```rust
   use reqwest::Client;
   use serde::{Deserialize, Serialize};

   const API_URL: &str = "https://api.elevenlabs.io";
   const API_KEY: &str = "YOUR_API_KEY";

   #[derive(Serialize)]
   struct SynthesisRequest<'a> {
       text: &'a str,
       voice_id: &'a str,
       #[serde(rename = "API_KEY")]
       api_key: &'a str,
   }

   #[derive(Deserialize)]
   struct SynthesisResponse {
       audio_url: String,
   }

   async fn synthesize_speech(text: &str, voice_id: &str) -> Result<String, reqwest::Error> {
       let client = Client::new();
       let request = SynthesisRequest {
           text,
           voice_id,
           api_key: API_KEY,
       };

       let response = client
           .post(format!("{}/synthesize", API_URL))
           .json(&request)
           .send()
           .await?;

       let synthesis_response: SynthesisResponse = response.json().await?;
       Ok(synthesis_response.audio_url)
   }
   ```

5. Update the `main.rs` file with the following code:
   ```rust
   mod elevenlabs;

   use clipboard::ClipboardContext;
   use elevenlabs::synthesize_speech;
   use std::io;

   #[tokio::main]
   async fn main() -> Result<(), Box<dyn std::error::Error>> {
       let mut ctx = ClipboardContext::new()?;
       let clipboard_content = ctx.get_contents()?;

       println!("Clipboard content: {}", clipboard_content);

       let voice_id = "YOUR_VOICE_ID";
       let audio_url = synthesize_speech(&clipboard_content, voice_id).await?;

       println!("Audio URL: {}", audio_url);

       Ok(())
   }
   ```

6. Replace `"YOUR_API_KEY"` in the `elevenlabs.rs` file with your actual ElevenLabs API key.

7. Replace `"YOUR_VOICE_ID"` in the `main.rs` file with the desired voice ID from the ElevenLabs API.

8. Run the app using the command `cargo run`.

The app will retrieve the contents of the clipboard, send a synthesis request to the ElevenLabs API, and print the URL of the generated audio file.

Note: Make sure you have the necessary dependencies installed, such as `reqwest`, `serde`, `serde_json`, and `clipboard`.

